import './App.css';

import { useState, useEffect  } from "react";
import Header from './components/Header';

const url = "http://127.0.0.1:8000/api/listar-curriculo";
const headerRequest = {
  'Access-Control-Allow-Headers': '*'
};

function App() {
  const [dadosCurriculo, setDadosCurriculo] = useState([]);

  useEffect (() => {
      async function fetchData() {
        const res = await fetch(url, {method: 'GET', headers: headerRequest});
        const data = await res.json();
        setDadosCurriculo(data);
      }

      fetchData();
  }, []);

  console.log(dadosCurriculo);

  return (
    <div className="App">
      <Header />
    </div>
  );
}

export default App;
